import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Header from './components/navbar';
import Practice from './pages/practice/practice';

function App() {
  return (
    <div >

    <Router>
    <Header/>
      <Switch>
        <Route path="/" component={Practice}/>
        {/* <Route path="/rank" component={}/> */}

      </Switch>
    </Router>
    {/* <Practice/> */}
    </div>
  );
}

export default App;
